    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on San Diego Bay NWR (Sweetwater Marsh and South
    San Diego Bay Units) for the next 15 years. This plan outlines the refuges' vision
    and purpose and describes how the refuges will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the Refuge, an overview
    of the CCP process, alternatives, a description of the affected environment, environmental
    consequences, and consultation with others. Key planning issues include: boundary
    expansion, tidal circulation, contaminants, habitat restoration, invasive species,
    control, predator management, and urban development.",nt"license_title": "License
